import React from "react";
import { HiSearch } from "react-icons/hi";
import "./header.scss";
import { Link } from "react-router-dom";
const Header = () => {

  searchHandler=()=>{
    
  }

  return (
    <div className="header">
      <div className="header__container container">
        <div className="header__container__row row">
          <div className="header__container__row__logo col-4">
            <h1>logo</h1>
          </div>
          <div className="header__container__row__navs col-4">
            <ul>
              <li>
                <Link className="link" to="/">
                  home
                </Link>
              </li>
              <li>
                <Link className="link" to="/users">
                  users
                </Link>
              </li>
            </ul>
          </div>
          <div className="header__container__row__search col-4">
            <input onChange={searchHandler} type="text" placeholder="search user" />
            <button>
              <HiSearch />
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
